declare const SQL_QUERY = "\nINSERT INTO Turf (\n  \"id\", \"shapeId\", \"createdAt\", \"updatedAt\", \"deletedAt\", \"type\", \"state\", \"county\", \"group\", \"name\", \"lat\", \"lng\", \"latMin\", \"latMax\", \"lngMin\", \"lngMax\", \"area\"\n) VALUES (\n  @id, @shapeId, @createdAt, @updatedAt, @deletedAt, @type, @state, @county, @group, @name, @lat, @lng, @latMin, @latMax, @lngMin, @lngMax, @area\n)\nON CONFLICT (\"id\") DO UPDATE SET\n\"shapeId\" = IFNULL(@shapeId, \"shapeId\"), \"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"type\" = IFNULL(@type, \"type\"), \"state\" = IFNULL(@state, \"state\"), \"county\" = IFNULL(@county, \"county\"), \"group\" = IFNULL(@group, \"group\"), \"name\" = IFNULL(@name, \"name\"), \"lat\" = IFNULL(@lat, \"lat\"), \"lng\" = IFNULL(@lng, \"lng\"), \"latMin\" = IFNULL(@latMin, \"latMin\"), \"latMax\" = IFNULL(@latMax, \"latMax\"), \"lngMin\" = IFNULL(@lngMin, \"lngMin\"), \"lngMax\" = IFNULL(@lngMax, \"lngMax\"), \"area\" = IFNULL(@area, \"area\")\n";
export default SQL_QUERY;
